import React from 'react';
import Dashboard from './components/Dashboard.js';
import { CssBaseline, ThemeProvider, createTheme } from '@mui/material';

// Create a theme suited for energy market dashboard
const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1565c0', // Darker blue
    },
    secondary: {
      main: '#00838f', // Teal
    },
    background: {
      default: '#f5f5f5',
    },
  },
  typography: {
    h4: {
      fontWeight: 600,
    },
    h6: {
      fontWeight: 500,
    },
  },
});

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Dashboard />
    </ThemeProvider>
  );
};

export default App;
